import React, { Component } from "react";
import "./bar.css";
import Axios from "axios";

class bars extends Component {
  constructor(props) {
    super(props);
    this.state = {
      bar: [],
    };
  }
  componentDidMount = (props) => {
    Axios.get("/lawyersReporter").then((response) => {
      console.log(response.data);
      this.setState({
        bar: JSON.stringify(response.data),
      });
    });
  };
  render() {
    return (
      <div>
        <h2>Lawyers:{this.state}</h2>
        // <ul>{this.state.bar.map}</ul>
      </div>
    );
  }
}

export default bars;
